const providerObj = require('./providerObj');

let captureImages = ( results ) => {
	const urlCheck = /^https\:\/\/app/;
	let images = [];
	for ( let x = 0; x < results.images.length; x++ ) {
		if ( urlCheck.test(results.images[x]) === true ) {
			images.push( results.images[x] );
		}
	}
	return images;
};

module.exports = captureImages;